sample: '["\"Od dzi\u015b polscy kierowcy wreszcie mog\u0105 sprawdzi\u0107 punkty
  karne przez internet. Liczono, \u017ce b\u0119dzie to jeden z hitowych projekt\u00f3w
  rz\u0105du, ale pierwsze komentarze po jego uruchomieniu nie daj\u0105 ku temu wielkich
  nadziei. Wielu zawiedzionych jest faktem, i\u017c do skorzystania z systemu konieczne
  jest nie tylko wej\u015bcie pod odpowiedni adres internetowym, ale i posiadanie
  profilu zaufanego. A kto taki profil posiada, ten przedstawionymi mu danymi mo\u017ce
  zosta\u0107 zaskoczony i... zdezorientowany.\\nReklamowany od miesi\u0119cy system
  mia\u0142 bardzo mocno u\u0142atwi\u0107 \u017cycie polskim\\nkierowcom i da\u0107
  im \u0142atwy spos\u00f3b na zdobycie informacji o posiadanych punktach karnych.
  Kiedy jednak us\u0142uga wreszcie ruszy\u0142a, okaza\u0142o si\u0119, \u017ce wi\u0119kszo\u015b\u0107
  Polak\u00f3w wcale nie ma do niej \u0142atwego dost\u0119pu. By przez\\ninternet
  zdoby\u0107 wiedz\u0119 o posiadanych punktach karnych, trzeba posiada\u0107 profil
  zaufany. To rodzaj cyfrowego podpisu, kt\u00f3ry dost\u0119pny jest ju\u017c od
  lat, ale posiada go garstka obywateli.\\nWszystko dlatego, \u017ce profil zaufany
  konieczny do za\u0142atwiania spraw drog\u0105 elektroniczn\u0105 trzeba zdoby\u0107
  raczej w \\\"analogowy\\\", papierowy spos\u00f3b. Czyli stawi\u0107 si\u0119 w
  odpowiedniej instytucji z dokumentami. Profil zaufany da si\u0119 zdoby\u0107 te\u017c
  bez wychodzenia z domu, ale szans\u0119 maj\u0105 na to tylko osoby wcze\u015bniej
  posiadaj\u0105ce certyfikat kwalifikowany i klienci kilku bank\u00f3w, kt\u00f3re
  profil stwarzaj\u0105 na podstawie danych zdobytych przy zak\u0142adaniu konta.\\nA
  je\u015bli ju\u017c kto\u015b profil zaufany zdob\u0119dzie i kliknie, gdzie trzeba...
  zamiast interesuj\u0105cych go danych mo\u017ce trafi\u0107 na dezorientuj\u0105cy
  komunikat. Z systemu\\nObywatel.gov.pl tego samego na temat punkt\u00f3w karnych
  dowie si\u0119 bowiem osoba, kt\u00f3rej punkty karne nie zosta\u0142y naliczone,
  jak i kto\u015b, kto przekroczy\u0142 limit punkt\u00f3w karnych lub nie posiada
  uprawnie\u0144 do prowadzenia pojazd\u00f3w. \\\"Prawie informacje\\\" - podsumowuj\u0105
  internauci.\"", "\"Otwarte Zawody w Narciarstwie Alpejskim o Puchar Proboszcza Parafii
  \u015aw.M.M. Kolbe w Ci\u015bcu\\n10 lutego odby\u0142o si\u0119 uroczyste otwarcie
  oraz po\u015bwi\u0119cenie nowo powsta\u0142ego wyci\u0105gu w Ci\u015bcu. Po\u015bwi\u0119cenia
  obiektu dokona\u0142 Ks. Pra\u0142at W\u0142adys\u0142aw Nowobilski -...\\nZawody
  w Narciarstwie Alpejskim o Puchar W\u00f3jta Gminy W\u0119gierska G\u00f3rka\\nZawody
  o Puchar W\u00f3jta w narciarstwie alpejskim odby\u0142y si\u0119 w tym roku na
  wyci\u0105gu \\\"Za groniem\\\" w Ci\u015bcu.\\nVIII Bieg Gazdy\\nPonad 40 zawodnik\u00f3w
  posz\u0142o w \u015blady Justyny Kowalczyk i wzi\u0119\u0142o udzia\u0142 w zawodach
  w narciarstwie klasycznym, kt\u00f3re odby\u0142y si\u0119 w 2 marca 2013r. w okolicy...\\n\u015awi\u0119to
  tenisa sto\u0142owego w W\u0119gierskiej G\u00f3rce\\n9 marca mi\u0142o\u015bnicy
  tenisa sto\u0142owego rywalizowali o tytu\u0142 najlepszego zawodnika XX Pucharu
  W\u00f3jta Gminy W\u0119gierska G\u00f3rka w Tenisie Sto\u0142owym.\"", "\"Kurier
  Paczka W Ruchu Szczytno\\nPoszukujesz sprawdzonego kuriera w mie\u015bcie Szczytno?
  Broker kurierski EPAKA wsp\u00f3\u0142pracuje wy\u0142\u0105cznie z zaufanymi firmami
  kurierskimi, dlatego niezale\u017cnie od Twojego wyboru zawsze skorzystasz z us\u0142ug
  rzetelnej firmy. Je\u017celi dodatkowo zale\u017cy Ci na tanich us\u0142ugach, przygotowali\u015bmy
  dla Ciebie doskona\u0142\u0105 propozycj\u0119, kt\u00f3r\u0105 s\u0105 przesy\u0142ki
  kurierskie realizowane przez firm\u0119 Paczka w Ruchu w mie\u015bcie Szczytno.
  Kurier zosta\u0142 doceniony przez klient\u00f3w ze wzgl\u0119du na wysok\u0105
  terminowo\u015b\u0107 w dor\u0119czaniu paczek, mo\u017cliwo\u015b\u0107 korzystania
  z dodatkowych us\u0142ug, a tak\u017ce bezpiecze\u0144stwo nadawanych przesy\u0142ek.
  Decyduj\u0105c si\u0119 na przewo\u017anika Paczka w Ruchu w naszym serwisie, jego
  us\u0142ugi b\u0119d\u0105 kosztowa\u0107 Ci\u0119 jeszcze mniej. Cenisz rozwi\u0105zania,
  dzi\u0119ki kt\u00f3rym mo\u017cna zaoszcz\u0119dzi\u0107 pieni\u0105dze, jednocze\u015bnie
  mie\u0107 pewno\u015b\u0107 wysokiej jako\u015bci oferowanych us\u0142ug? Wybierz
  po\u015brednika EPAKA.\"", "\"Weselna pota\u0144c\u00f3wka bez nale\u017cytej oprawy
  muzycznej by\u0142aby jak\u2026 ca\u0142us bez w\u0105s\u00f3w. Muzykalna orkiestra,
  a w\u0142a\u015bciwie zesp\u00f3\u0142, ma nie tylko porywa\u0107 go\u015bci do
  ta\u0144ca, ale tak\u017ce organizowa\u0107 typowo weselne zabawy. Wodzirej to wi\u0119c
  osoba, kt\u00f3ra zajmuje po\u015br\u00f3d cz\u0142onk\u00f3w g\u0142\u00f3wne miejsce.\\nChocia\u017c
  do zimy pozosta\u0142o b\u0105d\u017a co b\u0105d\u017a sporo czasu, a pora wiosenna
  jest jeszcze bardzo daleko, to niekt\u00f3rzy rodziciele ju\u017c rozpocz\u0119li
  \u017cywio\u0142owe przygotowania do komunijnej uroczysto\u015bci. Rezerwacj\u0119
  sali restauracyjnej rozs\u0105dniej jest nie odk\u0142ada\u0107 na potem. Te bardziej
  szykowne i jednocze\u015bnie niedrogie lokale z pocz\u0105tkiem kolejnego roku mog\u0105
  by\u0107 ju\u017c dawno zarezerwowane, tak\u017ce na uroczysto\u015bci weselne albo
  jubileuszowe. Podobnie sprawa si\u0119 ma w przypadku garderoby \u2013 o dziewcz\u0119ce
  suknie komunijne b\u0105d\u017a ch\u0142opi\u0119ce mundurki trzeba zatroszczy\u0107
  si\u0119 odpowiednio wcze\u015bniej, aby p\u00f3\u017aniej zaoszcz\u0119dzi\u0107
  sobie niekoniecznego rozgor\u0105czkowania.\\n\u015awi\u0105teczne dni zwykle kojarz\u0105
  si\u0119 z ca\u0142\u0105 mas\u0105 zjawisk. S\u0105 wi\u0119c ogonki w galeriach
  handlowych, \u015bwi\u0119ty Miko\u0142aj i dom pachn\u0105cy ciastem. Przyjazd
  rodziny, \u015blicznie ubrana choinka i prezenty, du\u017co prezent\u00f3w.\\nWszystkie
  powody s\u0105 w\u0142a\u015bciwe, aby sprawi\u0107 przyjemno\u015b\u0107 bliskim,
  np. w postaci prezentu. Pewnie cz\u0119sto poddajesz si\u0119, gdy\u017c nie masz
  poj\u0119cia jaki prezent b\u0119dzie adekwatny do wieku obdarowywanego i zmy\u015blnej
  okazji. Dla potrzebuj\u0105cych weny przy doborze prezentu w necie jest mn\u00f3stwo
  propozycji. Continue reading \u201cDoskona\u0142y pomys\u0142 na doskona\u0142y
  prezent\u201d \u00bb\"", "\"ZR\u00d3B TO SAM Robot pude\u0142kowy. Z tym zestawem
  Twoje dziecko zmieni opakowanie w korpus robota! Zaobserwuje, jak si\u0119 przemieszcza
  i wykonuje zabawne ruchy. M\u0142ody konstruktor pozna podstawowe zagadnienia z
  zakresu mechaniki i \u0142\u0105czenia obwod\u00f3w, ale nie tylko. B\u0119dzie
  m\u00f3g\u0142 wykaza\u0107 si\u0119 inwencj\u0105 tw\u00f3rcz\u0105 i ozdobi\u0107
  robota, wykonuj\u0105c rysunki na pude\u0142ku. Do jego upi\u0119kszenia wykorzysta
  r\u00f3wnie\u017c foli\u0119 lub foliow\u0105 torebk\u0119.\\nTaki robot to bardzo
  ciekawa zabawa oraz nauka!\\n- zawarto\u015b\u0107 zestawu: - 1 modu\u0142 silnika,
  1 silnik z przek\u0142adni\u0105 \u015blimakow\u0105 i kablami, 1 pokrywa silnika,
  1 o\u015b z ko\u0142em z\u0119batym, 2 rurki, 2 krzywki, 2 os\u0142ony styk\u00f3w,
  2 \u015bruby, 2 nogi, 1 marker, instrukcja\\n- wymiary pude\u0142ka: 9x9x13 cm\\n-
  wymagany nadz\u00f3r osoby doros\u0142ej\"", "\"Format: CD, DVD/Blu-ray\\nData premiery:
  02.11.2009\\nLabel: DEMON\\n60 utwor\u00f3w bo\u017conarodzeniowych w interpretacji
  wybitnych wykonawc\u00f3w, 20 bardziej ju\u017c \u015bwieckich kawa\u0142k\u00f3w
  do ta\u0144czenia wok\u00f3\u0142 choinki oraz 20 podk\u0142ad\u00f3w karaoke na
  osobnym dysku DVD dla tych, kt\u00f3rzy niekoniecznie pami\u0119taj\u0105 wszystkie
  s\u0142owa \u015bwi\u0105tecznych piosenek.\\nNa polskim rynku jest to absolutny
  niezb\u0119dnik dla wszystkich tych, kt\u00f3rzy opr\u00f3cz polskich kol\u0119d
  chcieliby sobie troch\u0119 pos\u0142ucha\u0107 angielskich piosenek o tematyce
  \u015bwi\u0105tecznej i zimowej w pierwszorz\u0119dnym wykonaniu, a nawet troch\u0119
  po\u015bpiewa\u0107 w tym j\u0119zyku, w czym znakomicie dopomo\u017ce dysk karaoke
  DVD. W\u015br\u00f3d znanych i lubianych piosenek bo\u017conarodzeniowych zebranych
  na trzech CD nie zabrak\u0142o klasycznych, nie\u015bmiertelnych nagra\u0144 w rodzaju
  \u201eWhite Christmas\\\" Binga Crosby''ego, \u201eSilent Night\\\" Franka Sinatry,
  \u201eThe Christmas Song (Merry Christmas To You)\\\" Nat King Cole''a czy \u201eWinter
  Wonderland\\\" Louisa Armstronga, ale te\u017c sporo tu starszych i nowszych utwor\u00f3w
  o tematyce \u015bwi\u0105tecznej w wykonaniu gwiazd country, rocka, popu czy nawet
  rapu. Do\u015b\u0107 wspomnie\u0107 \u201eBlue Christmas\\\" Johnn''ego Casha, \u201eChristmas
  To Remeber\\\" duetu Dolly Parton - Kenny Rogers, \u201eChristmas Bop\\\" T. Rex,
  \u201eStep Into Christmas\\\" The Wedding Present, \u201eI Still Believe In Santa
  Claus\\\" New Kids On The Block czy \u201eChristmas In Hollis\\\" Run-DMC.\"", "\"15
  i 16 marca \u017ce\u0144ska i m\u0119ska reprezentacja \u201eKasprowicza\u201d w
  koszyk\u00f3wce rozegra\u0142a \u0107wier\u0107fina\u0142owe turnieje Kujawsko-Pomorskiej
  Licealiady. Ch\u0142opcy broni\u0105 tytu\u0142u mistrzowskiego zdobytego przed
  rokiem, natomiast dziewczyny b\u0119d\u0105 chcia\u0142y powt\u00f3rzy\u0107 wynik
  z zesz\u0142ego roku, w kt\u00f3rym zdoby\u0142y srebro. Dru\u017cyna dziewcz\u0105t
  rozgrywki powiatowe zako\u0144czy\u0142a na I miejscu, a ch\u0142opcy na II \u2013
  ulegli tylko nieznacznie \u201eChemikowi\u201d.\\n15 marca sw\u00f3j turniej rozegrali
  ch\u0142opcy. Ich przeciwnikiem by\u0142y dru\u017cyny I LO w Szubinie, II LO w
  Bydgoszczy i ZSAE w Karolewie. \u201eKasper\u201d w obu meczach by\u0142 zdecydowanie
  lepszy i zas\u0142u\u017cenie awansowa\u0142 do p\u00f3\u0142fina\u0142u Licealiady.\\nDziewcz\u0119ta
  sw\u00f3j \u0107wier\u0107fina\u0142 rozegra\u0142y 16 marca z dru\u017cynami IV
  LO w Bydgoszczy i ZSAE w Karolewie. Podobnie jak ch\u0142opcy, koszykarki z \u201eKaspra\u201d
  nie pozostawi\u0142y rywalkom cienia szans i zdecydowanie wygra\u0142y oba spotkania,
  awansuj\u0105c do p\u00f3\u0142fina\u0142u Licealiady.\"", "\"Witamy serdecznie
  wszystkich zainteresowanych aromaterapi\u0105. Pragniemy przedstawi\u0107 Pa\u0144stwu
  szeroka gam\u0119 najwy\u017cszej klasy i czysto\u015bci biologicznej produkty Primavera.
  Mamy nadziej\u0119, \u017ce przybli\u017cymy Pa\u0144stwu cudowny \u015bwiat olejk\u00f3w
  eterycznych.szczeg\u00f3\u0142y wpisu\\nPerfumy - Perfand. Produkcja perfum, w\u00f3d
  perfumowanych oraz w\u00f3d toaletowych o szerokiej gamie zapachowej dla kobiet
  i m\u0119\u017cczyzn. perfumy - wiosenna \u015bwie\u017co\u015b\u0107 naszej perfumy
  to co\u015b czego potrzebujesz.szczeg\u00f3\u0142y wpisu\\nW ofercie firmy znale\u017a\u0107
  mo\u017cna krem na problemy sk\u00f3rne, kt\u00f3ry dzia\u0142a nawil\u017caj\u0105co,
  regeneruj\u0105co i \u0142agodz\u0105co. Stosuje si\u0119 go np. przy piel\u0119gnacji
  sk\u00f3ry dotkni\u0119tej \u0142uszczyc\u0105.szczeg\u00f3\u0142y wpisu\\nW asortymencie
  naszego sklepu znajdziecie kompleksowe wyposa\u017cenie dla Waszych salon\u00f3w
  kosmetycznych. Przygotowany przez nas zosta\u0142 mi\u0119dzy innymi sprz\u0119t
  do wykonywania zabieg\u00f3w w salonach pi\u0119kno\u015bci, urody.szczeg\u00f3\u0142y
  wpisu\\nInternetowy katalog produkt\u00f3w FM Group z mo\u017cliwo\u015bci\u0105
  zam\u00f3wienia. Na stronie dost\u0119pne s\u0105 r\u00f3wnie\u017c katalogi w postaci
  plik\u00f3w PDFszczeg\u00f3\u0142y wpisu\\nAgencja Kontact hurtownia kosmetyk\u00f3w
  zajmuje si\u0119 detaliczn\u0105, a przewa\u017cnie hurtow\u0105 sprzeda\u017c\u0105
  zaawansowanych kosmetyk\u00f3w, kt\u00f3re znajduj\u0105 zastosowanie w profesjonalnych
  us\u0142ugach kosmetycznych.szczeg\u00f3\u0142y wpisu\\nProfesjonalne kosmetyki
  dla gabinet\u00f3w kosmetycznych. Preparaty tej firmy to wysoka jako\u015b\u0107
  i bezpiecze\u0144stwo pracy w ka\u017cdym gabinecie kosmetycznym.szczeg\u00f3\u0142y
  wpisu\\nMydlarnia u Koz\u0142a we Wroc\u0142awiu to sklep z naturalnymi kosmetykami
  oraz \u017cywno\u015bci\u0105 ekologiczn\u0105 , specjalnie stworzonymi, by skutecznie
  dzia\u0142a\u0107 na nasze zmys\u0142y i cia\u0142o. U nas znajdziesz, prawdziwe
  piel\u0119gnacyjne skarby z r\u00f3\u017cnych zak\u0105tk\u00f3w \u015bwiata. szczeg\u00f3\u0142y
  wpisu\\nAsortyment naszej hurtowni obejmuje urz\u0105dzenia kosmetyczne oraz profesjonalne
  preparaty do piel\u0119gnacji cia\u0142a. Proponowane s\u0105 mi\u0119dzy innymi
  lakiery hybrydowe w szerokiej gamie kolorystycznej.szczeg\u00f3\u0142y wpisu\\nW\u0142oskie
  kosmetyki do w\u0142os\u00f3w, sk\u00f3ry g\u0142owy, twarzy i cia\u0142a. Dost\u0119pne
  jedynie w aptekach. naturalne preparaty, fitokosmetyki wysokiej jako\u015bci. Serwis
  dermokonsultacji (komputerowego badania w\u0142os\u00f3w i sk\u00f3ry) w aptekach.
  Kuracje do w\u0142os\u00f3w i sk\u00f3ry g\u0142owy.szczeg\u00f3\u0142y wpisu\\nPrzedstawiciel
  firmy bran\u017cy fryzjerskiej Keune Haircosmetics, oferuje produkty fryzjerskie
