  O PRODUKCIE\\nRoadmax jest skrzyd\u0142em przeznaczonym dla szerokiego grona pilot\u00f3w
  od pocz\u0105tkuj\u0105cych\\npo zaawansowanych. Idealny do latania trajk\u0105
  solo lub w lekkim tandemie.\\nOpracowany z my\u015bla o niskich pr\u0119dko\u015bciach
