  na modelu Roadster 3 i jednocze\u015bnie zawiera najnowsze technologie i innowacje
  u\u0142atwiaj\u0105ce latanie na trajce.\\nTECHNOLOGIA\\nDzi\u0119ki zastosowaniu
  profilu Shark Nose OZONE Reflex (OZRP), zaprojektowanego specjalnie do latania z
  nap\u0119dem, Roadmax jest stabilny w przyspieszonym locie i jednocze\u015bnie odporny
  na przeci\u0105gni\u0119cia i spirale upadkowe przy niskich pr\u0119dko\u015bciach.\\nSkrzyde\u0142ka
  poprawiaj\u0105 stabilno\u015b\u0107 czaszy zar\u00f3wno w powietrzu jak i na ziemi
  oraz zmniejszaj\u0105 szanse na niezamierzone pozostanie w spirali.\\nCHARAKTERYSTYKA
  LOTU\\nParalotnia \u0142atwo si\u0119 nape\u0142nia (bez nadmiernego przeskoku).
  Z \u0142atwo\u015bci\u0105 utrzymasz kurs wzd\u0142u\u017c pasa startowego. Dzi\u0119ki
  temu oderwanie od gruntu nast\u0119puje szybko, a wznoszenie jest p\u0142ynne i
  efektywne. W powietrzu skrzyd\u0142o jest szybkie, przyjemne i komfortowe.\\nReakcja
  ster\u00f3wek jest precyzyjna, ale jednocze\u015bnie wybaczaj\u0105ca b\u0142\u0119dy,
  co daje rado\u015b\u0107\\nz pilota\u017cu i \u0142atwo\u015b\u0107 manewrowania
  z niespotykanym poziomem stabilno\u015bci w locie.\\nTA\u015aMY\\nNowe, ta\u015bmy
  no\u015bne s\u0105 kr\u00f3tsze ni\u017c standardowe, wyposa\u017cone w najnowsze,
  wygodniejsze uchwyty, system A-assist u\u0142atwiaj\u0105cy nape\u0142nianie oraz
  d\u0142ugi zakres trymer\u00f3w u\u0142atwiaj\u0105cy kontrol\u0119 pr\u0119dko\u015bci.
  Posiadaj\u0105 du\u017ce ster\u00f3wki i ma\u0142e TST (system 2D dla zwinno\u015bci
  i precyzji). TST u\u017cywamy przy wi\u0119kszych pr\u0119dko\u015bciach. Umieszczone
  nisko na ta\u015bmach no\u015bnych,\\nby by\u0142y \u0142atwo dost\u0119pne nawet
  przy wysokim punkcie podwieszenia.\\nTESTY OBCI\u0104\u017bENIOWE\\nTestowany do
  250kg przy 8g. Wewn\u0119trzna struktura i olinowanie Roadmaxa zosta\u0142y wzmocnione,
  dla wi\u0119kszego marginesu bezpiecze\u0144stwa strukturalnego przy du\u017cych
  obci\u0105\u017ceniach.\\nPILOT\\nOdpowiedni dla \u015bredniozaawansowanych pilot\u00f3w,
  jednak ze wzgl\u0119du na ma\u0142\u0105 powierzchni\u0119\\ni du\u017ce obci\u0105\u017cenie
