  r\u00f3\u017cnego rodzaju firmach, zapewniaj\u0105c tym samym bezpo\u015bredni dost\u0119p
  do wody dla ka\u017cdego pracownika.\\n- Mechaniczne \u2013 modele tego typu serwuj\u0105
  wod\u0119 w temperaturze pokojowej. W zwi\u0105zku z tym u\u017cytkownik nie ma
