  mineralnych.\\nDystrybutory wody \u2013 polecane modele\\nProficook HWS-1145\\nProficook
  HWS-1145 to idealne rozwi\u0105zanie do firmowych biur, gdzie ka\u017cdego dnia
  zaparzane s\u0105 dziesi\u0105tki kaw i herbat. Model ten oferuje bowiem natychmiastow\u0105
