  w zale\u017cno\u015bci od potrzeb.\\nObs\u0142uga dystrybutora jest ca\u0142kowicie
  nieskomplikowana, dzi\u0119ki czemu poradz\u0105 sobie z ni\u0105 nawet zupe\u0142nie
