  co jest on w stanie pos\u0142u\u017cy\u0107 d\u0142ugie lata. Warto r\u00f3wnie\u017c
  zwr\u00f3ci\u0107 uwag\u0119 na klasyczny wygl\u0105d, kt\u00f3ry sprawia, \u017ce
  dystrybutor wpasuje si\u0119 zasadniczo w dowoln\u0105 przestrze\u0144.\\nInox HC66L\\nInox
  HC66L to bezbutlowy dystrybutor zimnej i ciep\u0142ej wody, kt\u00f3ry doskonale
