  rozmaitych zak\u0142ad\u00f3w produkcyjnych. Model ten cechuje si\u0119 przyst\u0119pn\u0105
  cen\u0105, nowoczesnym wygl\u0105dem, a tak\u017ce wysok\u0105 jako\u015bci\u0105
  wykonania z wykorzystaniem solidnych i trwa\u0142ych materia\u0142\u00f3w.\\nDystrybutor
  oferuje wod\u0119 w temperaturze 5-12\u00b0C lub 85-95\u00b0C. U\u017cytkownicy
  maj\u0105 r\u00f3wnie\u017c mo\u017cliwo\u015b\u0107 wy\u0142\u0105czenia funkcji
