  wyr\u00f3\u017cnia smuk\u0142a budowa, dzi\u0119ki kt\u00f3rej dystrybutor wpasuje
  si\u0119 nawet w stosunkowo ograniczon\u0105 przestrze\u0144 na blatach lub p\u00f3\u0142kach
  w domach, biurach, salach konferencyjnych, czy poczekalniach.\\nCo wi\u0119cej,
  urz\u0105dzenie wyposa\u017cono w 3-stopniowy system filtracji, w kt\u00f3rym zastosowano
  filtry:\\n- PAC z w\u0119glem aktywnym \u2013 odpowiedzialny za usuwanie resztek
  chloru i niwelowanie wszelkich nieprzyjemnych zapach\u00f3w;\\n- RO (odwr\u00f3conej
  osmozy) \u2013 gwarantuj\u0105cy skuteczne i wysoce precyzyjne usuwanie metali ci\u0119\u017ckich,
